import React, { useState } from 'react';
import './App.css';

function App() {
  const [showRecipients, setShowRecipients] = useState(false);

  // 仮の送金先一覧データ
  const recipients = [
    '山田太郎',
    '佐藤花子',
    '鈴木一郎'
  ];

  return (
    <div>
      <h1>ユーザー名</h1>
      <p>口座番号</p>
      <button onClick={() => setShowRecipients(!showRecipients)}>
        送金先
      </button>
      {showRecipients && (
        <div>
          <h2>送金先一覧</h2>
          <ul>
            {recipients.map((recipient, index) => (
              <li key={index}>{recipient}</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
